import { Outlet } from 'react-router-dom';
import Navbar from '../NousNova/';
import Footer from '../DerwolfGroup/components/DerwolfGroupFooter';

function NousNovaLayout() {
  return (
    <>
      <Navbar />
      <Outlet />
      <Footer />
    </>
  );
}

export default NousNovaLayout;
